import react from 'react';

const reviewInfo = props => {

  return (
    <table>
      <tbody>
        <tr>
          <td><span>Your Name:</span></td>
          <td><span>{props.name}</span></td>
        </tr>
      </tbody>
    </table>
  )
};

export default reviewInfo;
